  h ^= (upperVal != null) ? upperVal.hashCode() : -1674416163;
  h ^= (parser != null) ? parser.hashCode() : -1572457324;
  h ^= (includeLower ? 1549299360 : -365038026) ^ (includeUpper ? 1721088258 : 1948649653);
  return h;
}

